import logo from './logo.svg';
import './App.css';
import Homme_page from "./Components/Hommepage/Homme_page"
import ContactUs from './Components/ContactUs/Contuct_Us';
import { BrowserRouter as Router ,Routes,Route } from 'react-router-dom';
function App() {
  return (
    <div className="App">
       <Homme_page/>

       <br/>
       <br/>
       <ContactUs/>






       <Router>
            <Routes>
                <Route path="" />
            </Routes>
       </Router>
    </div>
  );
}

export default App;
